import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 19.2-57 Execution and return of warrant; list of property seized.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-57.md","filePath":"vacode/19.2-57.md"}'),i={name:"vacode/19.2-57.md"},o=a('<h1 id="§-19-2-57-execution-and-return-of-warrant-list-of-property-seized" tabindex="-1">§ 19.2-57 Execution and return of warrant; list of property seized. <a class="header-anchor" href="#§-19-2-57-execution-and-return-of-warrant-list-of-property-seized" aria-label="Permalink to &quot;§ 19.2-57 Execution and return of warrant; list of property seized.&quot;">​</a></h1><p>The warrant shall be executed by the search of the place described in the warrant and, if property described in the warrant is found there, by the seizure of the property. The officer who seizes any property shall prepare an inventory thereof, under oath. An inventory of any seized property shall be produced before the circuit court of the county or city where the search was conducted. The officer executing the warrant shall endorse the date of execution thereon and the officer or his designee shall file the warrant, with the inventory attached (or a notation that no property was seized) and the accompanying affidavit, unless such affidavit was made by voice or videotape recording, within three days after the execution of such search warrant in the circuit court clerk&#39;s office, wherein the search was made, as provided in § <a href="http://law.lis.virginia.gov/vacode/19.2-54/" target="_blank" rel="noreferrer">19.2-54</a>. Saturdays, Sundays, or any federal or state legal holiday shall not be used in computing the three-day filing period. The officer, or his designee or agent, may file the warrant, inventory, and accompanying affidavit by delivering them in person, or by mailing them certified mail, return receipt requested, or delivering them by electronically transmitted facsimile process.</p><p>Code 1950, § 19.1-87.1; 1970, c. 416; 1973, c. 11; 1975, c. 495; 1976, cc. 142, 552; 1977, c. 109; 1980, c. 573; 1984, c. 491; 2008, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0147" target="_blank" rel="noreferrer">147</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0183" target="_blank" rel="noreferrer">183</a>.</p>',3),n=[o];function c(s,d,h,l,f,p){return r(),t("div",null,n)}const _=e(i,[["render",c]]);export{y as __pageData,_ as default};
